import React, { useState } from "react";

const Incdec = () =>{

    const [Num, setNum] = useState(0);

    const incNum = () =>{

        setNum(Num+1)
    }



    return (
    <>
        <div>
            <h1> {Num} </h1>
            <button onClick={incNum}>Inc</button>
            <button>Dec</button>
        </div>
    </>

    );
};
export default Incdec;
